(604, NULL, NULL, 'REVWS_SETTINGS', '{\"general\":{\"multilang\":true},\"theme\":{\"shape\":\"heart\",\"shapeSize\":{\"product\":16,\"list\":16,\"create\":80},\"colors\":{\"fillColor\":\"#ffd055\",\"borderColor\":\"#ffd055\",\"fillColorOff\":\"transparent\",\"borderColorOff\":\"#d5d5d5\"}},\"display\":{\"product\":{\"placement\":\"tab\",\"reviewsPerPage\":5,\"orderBy\":\"date\",\"averagePlacement\":\"buttons\",\"hideEmptyReviews\":false,\"showSignInButton\":true},\"productList\":{\"show\":true,\"noReviews\":\"omit\"},\"productComparison\":{\"show\":true},\"myReviews\":{\"show\":true,\"iconClass\":\"\",\"reviewsPerPage\":5,\"maxRequests\":3},\"allReviews\":{\"reviewsPerPage\":10}},\"moderation\":{\"enabled\":true,\"needApprove\":{\"create\":true,\"edit\":true,\"reported\":false}},\"review\":{\"displayName\":\"fullName\",\"allowGuestReviews\":true,\"allowReviewWithoutCriteria\":false,\"allowEmpty\":true,\"allowDelete\":true,\"allowEdit\":true,\"allowVoting\":true,\"allowReporting\":true,\"displayCriteria\":\"none\"},\"notifications\":{\"admin\":{\"email\":\"padilo300@gmail.com\",\"language\":1,\"reviewCreated\":false,\"reviewUpdated\":false,\"reviewDeleted\":false,\"needApprove\":true},\"author\":{\"thankYou\":true,\"reviewApproved\":true,\"reviewDeleted\":true,\"reply\":true}},\"richSnippets\":{\"enabled\":true},\"images\":{\"enabled\":true,\"allowNewImages\":true,\"maxFileSize\":3,\"width\":800,\"height\":800,\"thumbWidth\":100,\"thumbHeight\":100},\"gdpr\":{\"implementation\":\"none\",\"requiredForCustomers\":true}}', '2019-05-29 06:41:15', '2019-05-29 06:50:38'),
(605, NULL, NULL, 'REVWS_CHECK_VERSION', '{\"ts\":1560339226794,\"version\":\"1.0.24\",\"notes\":\"\\nThis version brings following enhancements and some bugfixes\\n\\n### Enhancements\\n- Reviews with empty titles are now supported\\n- Review tab label now shows number of total reviews\\n- Customer is redirected back to product page after login\\n- Added default css for review average custom placement\\n- Italian translation\\n- French translation\\n\\n### Bugfixes\\n- Fixed image overflow issue\\n- Fixed images being stretched in firefox\\n- Fixed ordering by usefulness\\n\\nEnjoy.\\n\",\"paid\":\"There is also **premium version** of this module with additional functionality\\n\\n### Store reviews\\n\\nThis functionality will allow your customers to leave reviews not only for your products, but for you website as well. You can display these reviews prominently on your homepage to increase trust and sales.\\n\\n### Email automations\\n\\nThis module can automatically send emails to those customers that had recently made a purchase, and ask them to leave a review. This is great tool to get more reviews, and also bring your customers back to your website.\\n\\n### Upgrade now\\n\\nYou can upgrade to premium version for only **39.99 EUR**. This price includes **all future updates** of the module\\n\"}', '2019-05-29 06:49:56', '2019-06-12 14:33:47'),
