(675, NULL, NULL, 'smartpromotion_smartblog_about_us', 'a:1:{s:7:\"content\";s:6343:\"&lt;style type=&quot;text/css&quot;&gt;\n.user-html h2 {\n	margin-top: 0;\n    border-bottom: 1px solid #d4d4d4;\n    font-size: 23px;\n    line-height: 30px;\n    padding-bottom: 10px;\n	margin: 30px 0 20px;\n    padding: 0;\n    color: #545454;\n    font-weight: inherit;\n\n}\n&lt;/style&gt;\n&lt;div class=&quot;user-bio&quot;&gt;\n	&lt;div class=&quot;user-html&quot;&gt;\n		&lt;h2&gt;Smart Data Soft&lt;/h2&gt;\n		&lt;p&gt;Smart Data Soft is one of well-known web development firm who has a remarkable reputation across the world with various web development services. We&rsquo;ve developed a huge no of top selling themes and plugins for Prestashop, WordPress&amp;amp;OpenCart platform. We are the first Prestashop partner agency from Bangladesh, and we&rsquo;re the proud translator of Prestashop CMS into the Bengali language. We&rsquo;ve also developed a PrestaShop free blog module named SmartBlog, which is the most popular and used blog ever on PrestaShop platform.&lt;/p&gt;\n\n		&lt;h2&gt; Why Smart Data Soft ?&lt;/h2&gt;\n\n		&lt;p&gt;We&rsquo;ve gained our high reputation not only for developing high quality and creative products but also for our tremendous and extensive custom support. We always prioritize quality over quantity, that&rsquo;s why all of our customers are always cheerful to buy our products and services. All of our clients firmly believes that they will get the best output with unalloyed quality from Smart Data Soft within very quick time.\n		We always love to take more critical challenges for our customers and give them the better solution than their expectation. If you&rsquo;re searching high quality with reasonable payment, so you come at the best place who can deliver the best for you after fulfilling your requirements.&lt;/p&gt;\n\n\n		&lt;h4&gt;You can select us for these reason:&lt;/h4&gt;\n		&lt;ul&gt;\n			&lt;li&gt;We believe in Quality&lt;/li&gt;\n			&lt;li&gt;We are sincere and dedicated to our work.&lt;/li&gt;\n			&lt;li&gt;We are concerned to keep our projects bug free.&lt;/li&gt;\n			&lt;li&gt;We developed user-friendly interfaces&lt;/li&gt;\n			&lt;li&gt;We are focused on customer requirement &amp;amp; choice&lt;/li&gt;\n			&lt;li&gt;We are capable of creating mobile/tabletPC friendly ecommerce applications.&lt;/li&gt;\n			&lt;li&gt;We are experienced in Responsive development&lt;/li&gt;\n			&lt;li&gt;We are always learning and try to implement latest technologies on our projects. &lt;/li&gt;\n		&lt;/ul&gt;\n    \n	&lt;/div&gt;\n&lt;/div&gt;\n&lt;br/&gt;&lt;br/&gt;\n&lt;hr&gt;\n&lt;br/&gt;\n&lt;h2&gt;Social profiles&lt;/h2&gt;\n&lt;div class=&quot;e-box -background-light h-p2 -radius-none -stacked&quot;&gt;\n  &lt;div class=&quot;social-networks&quot;&gt;\n        &lt;a href=&quot;https://behance.net/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Behance&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Behance&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/behance-d3914a2cf37b7551ff69a1d159e050338f4e22a2686fee69e8fe9dafca7076c5.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://dribbble.com/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Dribbble&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Dribbble&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/dribbble-b98dc4c13cf5ba8efedf26e744c611c0601c04730cdfabb11f3a0dc239b873a4.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://www.facebook.com/people/@/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Facebook&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Facebook&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/facebook-b536aff8cceed5729250ca8bbb206e6b567ffc11e12bc060c65c0d17233a4957.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://www.flickr.com/photos/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Flickr&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Flickr&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/flickr-e14ae59e48fde1af395b2d19070fce6c40bac211cea92557f0a77391333d0542.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://github.com/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Github&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Github&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/github-624ce2b9cb0efd170de5a9e7cf11f5f4d7d2e9bb49a2112580cd2a11eebb6eaf.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://plus.google.com/111021323215407729036?rel=author&quot; rel=&quot;me&quot; title=&quot;Google+&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Google+&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/googleplus-b339b982411e2b628f6103e8d5aa5ad628d3ad4533b32c2ed8209063ea7c5e88.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://twitter.com/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Twitter&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Twitter&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/twitter-ea225968124e9f6fa0a595e8788b5558a9705300bf21003c457f95692394e09b.svg&quot;&gt;&lt;/a&gt;\n\n        &lt;a href=&quot;https://vimeo.com/smartdatasoft&quot; rel=&quot;me&quot; title=&quot;Vimeo&quot; target=&quot;_blank&quot;&gt;&lt;img height=&quot;34&quot; width=&quot;34&quot; alt=&quot;Vimeo&quot; src=&quot;https://public-assets.envato-static.com/assets/common/icons-buttons/social/vimeo-73fb3bb68fba9f5f0ce9221c0afe2d0e3b